import styled from "styled-components";
import Nav from "../components/Nav";
import FieldSection from "./sections/FieldSection";
import TeamSection from "./sections/TeamSection";
import ReportSection from "./sections/ReportSection";

const Div = styled.div`
  position: relative;
  height: 100%;
  min-height: 100vh;

  &::before {
    content: "";
    background-color: var(--dark-gray);
    height: 100%;
    width: 50%;
    position: absolute;
    right: 0;
    top: 0;
    z-index: -2;
  }
`;
const Content = styled.div`
  display: flex;
  border: solid pink;
`;

const BgLine = styled.div`
  border: solid 1px var(--gray);
  height: 650px;
  width: calc(100% - 60px);
  margin: 0px 30px;

  z-index: -1;
  position: relative;
  right: 0;
  overflow: hidden;

  &::before {
    content: "";
    border: solid 1px var(--gray);
    position: absolute;
    height: calc(100% - 20px);
    width: calc(100% - 20px);
    margin: 10px;
    z-index: -1;
  }
`;

const TeamSectionStyled = styled(TeamSection)`
  position: absolute;
  right: 0;
  z-index: 2;
`;

const Left = styled.div`
  width: 50%;
  border: solid red;
`;

const Right = styled(Left)``;

function Simulator() {
  return (
    <Div>
      <Nav></Nav>

      <Content>
        <Left>
          <FieldSection></FieldSection>
        </Left>
        <Right>
          <BgLine></BgLine>
        </Right>
      </Content>
    </Div>
  );
}

export default Simulator;
